        <main class="container main-container pb-5">
            <div class="col-12">
                <h1 id="list-title" class="center">Tu Du List</h1>
            </div>
            <div class="row"> 
                < OpenTasks />

                < LeftBar/>

                < RightBar/>
            </div>
        </main>
    );
}

export default Main;
